import React from 'react';

class CorpExplain extends React.Component {
    constructor (props) {
        super(props);

        };

        render() {
            return (
                <div id="explainContainer">
                    <div className="allText">
                        <p id="corpButtonTag" >Multi-Location</p>
                        <p id="corpExplain">Multiple converter buyers from several physical locations.</p>
                    </div>

                    <style jsx>
                        {`
                        
                        #explainContainer {
                            transform: translate(0%, -75px)
                        }

                        .allText {
                            transform: translate(0%, 0%)
                        }
                        
                        #corpExplain {
                            color: white;
                            pointer-events: none;
                            transform: translate(0%, 5px)
                        }
                        
                        @media only screen and (max-width: 720px) {
                            #explainContainer{
                                transform: translate(0%, 0%)
                            }
                        }

                        #corpButtonTag {
                            position: absolute;
                            color: black;
                            text-decoration: underline;
                            position: relative;
                            font-weight: 600;
                            font-size: 1.5em;
                            transform: translate(0%, -68px)
                          }

                        `}
                    </style>
                </div>
            )
        }
    }

export default CorpExplain;
